function mapValues(val, aMin, aMax, bMin, bMax) {
    var output = (((bMax - bMin) * (val - aMin)) / (aMax - aMin)) + bMin;
    if (output > 255)
        output = 255;
    if (output < 0)
        output = 0;
    return Math.round(output);
};

