    cmdexecution() {
        var byteCommands = []; // a compound command

        byteCommands[0] = 0x44;
        byteCommands[1] = 0x52;
        byteCommands[2] = 0x55;
        byteCommands[3] = 0x4E; // var HIGHT = parseFloat(args.HEIGHT);
        // Header (Bytes 0 - 6)

        var command = []; // command[0] = HEAD_CMD.HEAD_SEND_HIGH;

        command[0] = HEAD_CMD.HEAD_MULTIROTOR;
        command[1] = CMD_DIRECTION.SEND; // Calculate command length minus first two header bytes

        command[2] = CMD_Type.CMD_EXECUTION;
        command[3] = 0x46; //  ()

        command[4] = 0x43; //

        command[5] = 0x4D; //

        var len = byteCommands.length;
        command[6] = len; // 7
        // Bytecodes (Bytes 7 - n)
        //8---

        command = command.concat(byteCommands);
        var tmpsum = 0;

        for (i = 0; i < command.length; i++) {
            tmpsum += command[i];
        }

        command[6 + byteCommands.length + 1] = tmpsum & 0xFF; //

        console.log(command);
        this.ws.send(JSON.stringify(command));
    }

    hovering(args) {
        var byteCommands = []; // a compound command

        var SECONDS = parseFloat(args.SECONDS);

        if (SECONDS <= 0) {
            SECONDS = 0;
        } else if (SECONDS >= 300000) {
            SECONDS = 300000; //
        } else {
            SECONDS = parseFloat(args.SECONDS);
        } // byteCommands[0] = FLY_DIRECTION.DIRECTION_COUNTER_CLOCKWISE;
        //byteCommands[1] = this.numbertoHex(SECONDS);;
        // if(SECONDS>255&&SECONDS<=32767)
        // {
        //     byteCommands[1] = (SECONDS >> 8) & 0xFF   ;
        //     byteCommands[2] = SECONDS& 0xFF;
        // }else{
        //     byteCommands[1] = SECONDS;
        // }
        // for(i=0;i<4;i++)
        // {
        //     byteCommands[i+1]=(SECONDS>>(i*8))& 0xFF;
        // }


        byteCommands[0] = SECONDS >> 3 * 8 & 0xFF;
        byteCommands[1] = SECONDS >> 2 * 8 & 0xFF;
        byteCommands[2] = SECONDS >> 1 * 8 & 0xFF;
        byteCommands[3] = SECONDS >> 0 * 8 & 0xFF; // byteCommands[2] = 3;

        var cmd = this.generateCommand(
            HEAD_CMD.HEAD_MULTIROTOR, 
            CMD_DIRECTION.SEND, 
            CMD_Type.CMD_MOTION, 
            CMD_METHOD.MOVE_TYPE_HOVERING, 

            byteCommands
        ); //console.log(cmd.toString('hex'));

        console.log(cmd);
        this.ws.send(JSON.stringify(cmd));
    }

