    /**
     * Formats menus into a format suitable for block menus, and loading previously
     * saved projects:
     * [
     *   {
     *    text: label,
     *    value: index
     *   },
     *   {
     *    text: label,
     *    value: index
     *   },
     *   etc...
     * ]
     *
     * @param {array} menu - a menu to format.
     * @return {object} - a formatted menu as an object.
     * @private
     */
    _formatMenu(menu) {
        const m = [];
        for (let i = 0; i < menu.length; i++) {
            const obj = {};
            obj.text = menu[i];
            obj.value = i.toString();
            m.push(obj);
        }
        return m;
    }

    /**
     * 
     * @param {*} head 
     * @param {*} directionlow 
     * @param {*} type 
     * @param {*} methods 
     * @param {array} byteCommands 
     */
    generateCommand(head, directionlow, type, methods, byteCommands) {
        // Header (Bytes 0 - 6)
        var command = []; // command[0] = HEAD_CMD.HEAD_SEND_HIGH;

        command[0] = head;
        command[1] = directionlow; // Calculate command length minus first two header bytes

        command[2] = type;
        command[3] = methods; //  ()

        command[4] = CmdSequence >> 8 & 0xFF; //
        command[5] = CmdSequence & 0xFF; //

        CmdSequence++; //,

        if (CmdSequence > 65535) {
            CmdSequence = 0;
        }

        var len = byteCommands.length;
        command[6] = len; // 7
        // Bytecodes (Bytes 7 - n)
        //8---

        command = command.concat(byteCommands);
        var tmpsum = 0;

        for (i = 0; i < command.length; i++) {
            tmpsum += command[i];
        }

        command[6 + byteCommands.length + 1] = tmpsum & 0xFF; //

        return command;
    }



